export var SliderTrackItemAnchor;
(function (SliderTrackItemAnchor) {
    SliderTrackItemAnchor["selectedRangeMin"] = "selectedRangeMin";
    SliderTrackItemAnchor["selectedRangeMax"] = "selectedRangeMax";
    SliderTrackItemAnchor["totalRangeMin"] = "totalRangeMin";
    SliderTrackItemAnchor["totalRangeMax"] = "totalRangeMax";
    SliderTrackItemAnchor["constrainedRangeMin"] = "constrainedRangeMin";
    SliderTrackItemAnchor["constrainedRangeMax"] = "constrainedRangeMax";
})(SliderTrackItemAnchor || (SliderTrackItemAnchor = {}));
